private void selectData()
{
    if (!selectInventTransferLines)
    {
        if (inventTransferLinesQueryPacked)
        {
            selectInventTransferLines = new SysQueryRun(inventTransferLinesQueryPacked);
        }
        else
        {
            selectInventTransferLines = new SysQueryRun(queryStr(InventTransferReleaseOrderPicking));
        }
        selectInventTransferLines.promptShowSorting(false);
    }

    if (element.mustPromptForInventTransferLine() && selectInventTransferLines.prompt())
    {
        qbrShipDateUsed = SysQuery::findOrCreateRange(selectInventTransferLines.query().dataSourceTable(tableNum(InventTransferLine)),fieldNum(InventTransferLine,ShipDate));
        element.setDateRangeText();

        element.buildData(true);
    }
}

