public boolean validateWrite()
{
    boolean ret;
    boolean isCWItem;
    InventQty activateRemainder;
    PdsCWInventQty cwActivateReminder;
    InventMovement movement;
    InventQty reservQty;
    InventQty allReadyReservedQty;
    PdsCWInventQty pdsCWReservQty;
    PdsCWInventQty pdsCWAllReadyReservedQty;

    ret = super();

    isCWItem = PdsGlobal::pdsIsCWItem(inventTransferLine.ItemId);

    if (!isCWItem)
    {
        activateRemainder = inventTransferLine.qtyActivateRemainder();

        if (inventTransferLine.QtyShipNow > activateRemainder)
        {
            ret = checkFailed("@SYS90343");
        }
    }
    else
    {
        cwActivateReminder = inventTransferLine.pdsCWQtyActivateRemainder();

        if (inventTransferLine.PdsCWQtyShipNow > cwActivateReminder)
        {
            ret = checkFailed("@SYS4110510");
        }
    }

    // check for over activating
    if (ret)
    {
        ret = InventReleaseOrderPickingForm_Transfer::checkOverActivate(inventTransferLine, inventTransferLine.QtyShipNow, deductUnreserved.value(), inventTransferLine.PdsCWQtyShipNow);
    }

    if (ret && formCtrl)
    {
        ret = formCtrl.dataSourceValidateWrite();
    }

    // if ok - reserve qty
    if (ret)
    {
        movement = InventMovement::construct(inventTransferLine);
        allReadyReservedQty = movement.transIdSum().reserved();
        pdsCWAllReadyReservedQty = movement.transIdSum().pdsCWReserved();

        //if order is using autoreservation the entire qty will be reserved when updating the line - if user is trying to reserve less than full qty message will be shown
        if (movement.mustBeAutoReserved() && (inventTransferLine.QtyShipNow != movement.transQty() && allReadyReservedQty != movement.transQty()))
        {
            // For CW items, no need to recalculate InventTransferLine.QtyShipNow,
            // because calculation is properly done on table level using related InventTrans records.

            info("@SYS112524");
        }
        else if (inventTransferLine.QtyShipNow != inventTransferLine.orig().QtyShipNow) // if ok - reserve qty
        {
            reservQty = (- allReadyReservedQty) - inventTransferLine.QtyShipNow - inventTransferLine.qtyShipWMSReserved();
            pdsCWReservQty = (-pdsCWAllReadyReservedQty) - inventTransferLine.PdsCWQtyShipNow - inventTransferLine.pdsCWQtyShipWMSReserved();

            if (!isCWItem && reservQty < 0)   //Activate now is being increased - always continue
            {
                InventUpd_Reservation::updateReserveBuffer(inventTransferLine, reservQty);
                inventSum_ds.research();
            }
            else if (isCWItem && pdsCWReservQty < 0)   //Activate CW now is being increased - always continue
            {
                // Recalculate reservQty, to ensure it has the same sign when adjusting up and down
                reservQty = PdsCatchWeight::minInventQty(inventTransferLine.ItemId, pdsCWReservQty);
                InventUpd_Reservation::updateReserveBuffer(inventTransferLine, reservQty, InventMovSubType::None, pdsCWReservQty);
                inventTransferLine.QtyShipNow = -movement.transIdSum(true).reserved();
                inventSum_ds.research();
            }
        }
    }

    return ret;
}

public void init()
{
    super();

    inventTransferLine_ds.cacheAddMethod(tableMethodStr(InventTransferLine,qtyReservedOnOrder));
    inventTransferLine_ds.cacheAddMethod(tableMethodStr(InventTransferLine,qtyShipPickedAll));

