    inventTransferLine_ds.cacheAddMethod(tableMethodStr(InventTransferLine,qtyShipWMSNotReserved));
}

public edit InventQty reserveNow(boolean _set, InventTransferLine _inventTransferLine, InventQty _reserveNow)
{
    InventQty reservQty;
    InventMovement movement;
    container reserved;

    if (_set)
    {
        if (PdsGlobal::pdsIsCWItem(_inventTransferLine.ItemId))
        {
            throw error(strFmt("@PRO1994", _inventTransferLine.ItemId));
        }
        if (_reserveNow < 0)
        {
            error("@SYS4200");
        }
        else
        {
            movement = InventMovement::construct(_inventTransferLine);
            reservQty = (- movement.transIdSum().reserved()) - _reserveNow;

            if (reservQty)
            {
                InventUpd_Reservation::updateReserveBuffer(_inventTransferLine, reservQty);
                inventTransferLine_ds.reread();
                inventSum_ds.research();
                transferLineForReserveNow = 0; // ensure that cached values gets updated

                // write down activate now on transfer line if reservation is reduced
                reserved = _inventTransferLine.qtyReservedPhysical();

                if (inventTransferLine.QtyShipNow > conPeek(reserved, 1))
                {
                    inventTransferLine.QtyShipNow = conPeek(reserved, 1);
                    inventTransferLine_ds.write();
                }
            }
        }
    }

    if (_inventTransferLine.RecId != transferLineForReserveNow)
    {
        transferLineForReserveNow = _inventTransferLine.RecId;
        this.updateReserveNow(_inventTransferLine);
    }

    return transferLineReserveNow;
}

