/// <summary>
/// Returns and or sets the amount requested to be reserved
/// </summary>
/// <param name="_set">Set field value</param>
/// <param name="_inventTransferLine">Current InventTransferLine record</param>
/// <param name="_cwReserveNow">Quantity requested to be reserved</param>
/// <returns>Reserved Catch weight quantity.</returns>
public edit PdsCWInventQty pdsCWReserveNow(boolean _set,
    InventTransferLine _inventTransferLine,
    PdsCWInventQty _cwReserveNow)
{
    InventQty reservQty;
    PdsCWInventQty cwQty;
    PdsCWInventQty cwReservQty;
    InventMovement movement;

    if (_set && PdsGlobal::pdsIsCWItem(_inventTransferLine.ItemId))
    {
        if (_cwReserveNow < 0)
        {
            error("@SYS4200");
        }
        else
        {
            movement = InventMovement::construct(_inventTransferLine);

            cwReservQty = -movement.transIdSum().pdsCWReserved() -_cwReserveNow;

            if (cwReservQty)
            {
                reservQty = PdsCatchWeight::minInventQty(_inventTransferLine.ItemId,cwReservQty);
                InventUpd_Reservation::updateReserveBuffer(_inventTransferLine, reservQty,InventMovSubType::None,cwReservQty);
                inventTransferLine_ds.reread();
                inventSum_ds.research();

                // write down activate now on transfer line if reservation is reduced
                if (inventTransferLine.PdsCWQtyShipNow > _inventTransferLine.pdsCWQtyReservedPhysical())
                {
                    inventTransferLine.PdsCWQtyShipNow = _inventTransferLine.pdsCWQtyReservedPhysical();
                    inventTransferLine.QtyShipNow = PdsCatchWeight::inventQty(
                                                _inventTransferLine.ItemId,
                                                inventTransferLine.PdsCWQtyShipNow);
                    inventTransferLine.write();
                }

                this.updateReserveNow(_inventTransferLine);
            }
        }
    }

    cwQty = _inventTransferLine.pdsCWQtyReservedPhysical() + _inventTransferLine.pdsCWQtyReservedOnOrder();

    return cwQty;
}

