public void modified()
{
    if (inventTransferLine.RecId == transferLineForReserveNow)
    {
        // Reset cache RecordId to make sure reserved qty will be recalculated when current line is activated transfer qty
        transferLineForReserveNow = 0;
    }

    super();

    if (formCtrl)
    {
        formCtrl.fieldModified(fieldNum(InventTransferLine, QtyShipNow));
    }
    inventTransferLine_ds.write();
}

