public void clicked()
{
    InventTransferLine localInventTransferLine;
    Set transferIdSet = new Set(new DictField(tableNum(InventTransferLine), fieldNum(InventTransferLine, TransferId)).baseType());
    Array markedRecords;
    int rowIndex;

    // To support multiSelect mark one header per transfer order where at least one line exists with a value in inventDeliverNow
    markedRecords = new Array(Types::Integer);
    rowIndex = 1;

    for (localInventTransferLine = inventTransferLine_ds.getFirst() as InventTransferLine; localInventTransferLine; localInventTransferLine = inventTransferLine_ds.getNext() as InventTransferLine)
    {
        if (localInventTransferLine.QtyShipNow && !transferIdSet.in(localInventTransferLine.TransferId))
        {
            markedRecords.value(markedRecords.lastIndex() + 1, rowIndex);

            transferIdSet.add(localInventTransferLine.TransferId);
        }
        rowIndex++;
    }

    inventReleaseOrderPickingTmp_ds.markRecords(markedRecords);

    super();

    //  Unmark after posting
    markedRecords = new Array(Types::Integer);
    inventReleaseOrderPickingTmp_ds.markRecords(markedRecords);

    element.reCalculate();
}

